  false,\n\t\"url\": null,\n\t\"notes\": \"This MrSID-compressed true color dataset
  is one component of the digital orthophoto coverage (DOI) over Palm Beach County,
  FL. This dataset is comprised of 3-band 24-bit (red, green, and blue bands) DOI
  cells in MrSID format, 30:1 compression, at a 0.5-foot pixel resolution, based on
  the FL Statewide 5,000' x 5,000' tile system. This dataset was created from the
  GeoTIFF source imagery acquired through Leica ADS40/SH51 multispectral scanners
  during January 21 through February 4, 2009. The companion datasets to this coverage
  are the GeoTIFF true color and color infrared imagery following the same specifications
  and layout, as well as the color infrared MrSID dataset.\",\n\t\"license_title\":
